('05883228-BC3A-4457-93FF-BD799D51624A', 'Notify Opportunity', '2018-09-04 14:25:59', '2018-09-04 14:25:59', NULL, '1', '1', NULL, 0, NULL, '1', 'on', 'Notification to Opportunity: {bean.name}', 'Name: {bean.name}\r\nAccount: {bean.account_name}\r\nAmount: {bean.currency_symbol} {bean.amount}\r\nExpected closed date: {bean.date_closed} {bean.amount}\r\nType: {bean.opportunity_type}\r\nSales stage: {bean.sales_stage}\r\nDescription: {bean.description}\r\n\r\nDisplay the opportunity inside the CRM:\r\n{system.frontend_url}/opener.html?{bean.getFrontendUrlEncoded}', '<p>Name: {bean.name}</p>\r\n<p>Account: {bean.account_name}</p>\r\n<p>Amount: {bean.currency_symbol} {bean.amount}</p>\r\n<p>Expected closed date: {bean.date_closed} {bean.amount}</p>\r\n<p>Type: {bean.opportunity_type}</p>\r\n<p>Sales stage: {bean.sales_stage}</p>\r\n<p>Description: {bean.description}</p>\r\n\r\n<p><a href="{system.frontend_url}/opener.html?{bean.getFrontendUrlEncoded}">Display the opportunity inside the CRM</a></p>', 0, 'notification', 'Opportunities', 'en_us', NULL),
('069A21DB-980A-4FD1-9357-3A26719B9C62', 'Notify Contact', '2018-09-04 14:25:59', '2018-09-04 14:25:59', NULL, '1', '1', NULL, 0, NULL, '1', 'on', 'Benachrichtigung zu Kontakt: {bean.full_name}', 'Name: {bean.full_name}\r\nAdresse: {bean.primary_address_street}\r\n{bean.primary_address_country} {bean.primary_address_postalcode} {bean.primary_address_city}\r\nTelefon (beruflich): {bean.phone_work}\r\nTelefon (mobil): {bean.phone_mobile}\r\nE-Mail: {bean.email1}\r\nBeschreibung: {bean.description}\r\n\r\nKontakt im CRM anzeigen:\r\n{system.frontend_url}/opener.html?{bean.getFrontendUrlEncoded}', '<p>Name: {bean.full_name}</p>\r\n<p>Adresse: {bean.primary_address_street}<br>\r\n{bean.primary_address_country} {bean.primary_address_postalcode} {bean.primary_address_city}</p>\r\n<p>Telefon (beruflich): {bean.phone_work}</p>\r\n<p>Telefon (mobil): {bean.phone_mobile}</p>\r\n<p>E-Mail: {bean.email1}</p>\r\n<p>Beschreibung: {bean.description}</p>\r\n\r\n<p><a href="{system.frontend_url}/opener.html?{bean.getFrontendUrlEncoded}">Kontakt im CRM anzeigen</a></p>', 0, 'notification', 'Contacts', 'de_DE', NULL),
('0A56148E-D0A9-40F8-A2EE-1B55D50C8FBF', 'Notify Email', '2018-09-04 14:25:59', '2018-09-04 14:25:59', NULL, '1', '1', NULL, 0, NULL, '1', 'on', 'Email Notification • {bean.name}', 'Subject: {bean.name}\r\nDate sent: {bean.date_sent}', '<p>Subject: {bean.name}</p>\r\n<p>Date sent: {bean.date_sent}</p>', 0, 'notification', 'Emails', 'en_us', NULL),
('14cb2ef8-41f4-116e-5a53-5ad5a59d982e', 'System-generated password email [en]', '2018-04-17 07:37:55', '2018-04-17 07:37:55', NULL, '1', '1', 'This template is used when the System Administrator sends a new password to a user.', 0, NULL, '1', 'off', 'Your login credentials for the CRM', 'Here are your login credentials for the CRM:\r\n\r\nUsername: {bean.user_name}\r\nPassword: {value.password}\r\n\r\nDuring the first/next login you have to change the temporary password.\r\n\r\n{system.frontend_url}', '<p>Here are your login credentials for the CRM:</p>\r\n<p>Username: <b>{bean.user_name}</b><br>\r\nPassword: <b>{value.password}</b></p>\r\n<p>During the first/next login you have to change the temporary password.</p>\r\n<p><a href="{system.frontend_url}">CRM Login</a></p>', 0, 'sendCredentials', 'Users', 'en_us', NULL),
('27321751-262C-4DD5-B9CE-EF8A8E601068', 'Notify Account', '2018-09-04 14:25:59', '2018-09-04 14:25:59', NULL, '1', '1', NULL, 0, NULL, '1', 'on', 'Notification to Account: {bean.name}', 'Name: {bean.name}\r\nAddress: {bean.billing_address_street}\r\n{bean.primary_address_country} {bean.billing_address_postalcode} {bean.billing_address_city}\r\nPhone (office): {bean.phone_office}\r\nEmail: {bean.email1}\r\nType: {bean.account_type}\r\nDescription: {bean.description}\r\n\r\nDisplay the account inside the CRM:\r\n{system.frontend_url}/opener.html?{bean.getFrontendUrlEncoded}', '<p>Address: {bean.billing_address_street}<br>\r\n{bean.primary_address_country} {bean.billing_address_postalcode} {bean.billing_address_city}</p>\r\n<p>Phone (office): {bean.phone_office}</p>\r\n<p>Email: {bean.email1}</p>\r\n<p>Type: {bean.account_type}</p>\r\n<p>Description: {bean.description}</p>\r\n\r\n<p><a href="{system.frontend_url}/opener.html?{bean.getFrontendUrlEncoded}">Display the account inside the CRM</a></p>', 0, 'notification', 'Accounts', 'en_us', NULL),
('43AB03CE-C713-49EF-A8D7-68849DFC4DDF', 'Forgot Password Email (with Token) [en]', '2018-07-13 11:38:44', '2018-07-13 11:38:44', NULL, '1', '1', 'This template is used to send a user a token to reset the user\'s account password.', 0, NULL, '1', 'off', 'New password for your CRM account?', 'You recently requested to be able to reset your CRM password.\n\nTo do so, this is the token you have to enter: {value.token}\n\nNote that the token is time-limited.\n\nIf it was not you who requested this e-mail, consider this e-mail to be irrelevant. Continue to log in with your existing password and simply delete this email.', '<p>You recently requested to be able to reset your CRM password.</p>\r\n<p>To do so, this is the token you have to enter: <b>{value.token}</b></p>\r\n<p>Note that the token is time-limited.</p>\r\n<p>If it was not you who requested this e-mail, consider this e-mail to be irrelevant. Continue to log in with your existing password and simply delete this email.</p>', 0, 'sendTokenForNewPassword', 'Users', 'en_us', NULL),
