	('7a10a7d7-ade9-150d-6fff-5b488ff1c926', 'Forgot Password Email (with Token) [de]', '2018-07-13 11:38:44', '2018-07-13 11:38:44', NULL, '1', '1', 'Diese Vorlage wird verwendet, um dem Benutzer einen Token zum Zurücksetzen des Passworts zu senden.', 0, NULL, '1', 'off', 'Neues Passwort für Ihr CRM-Konto?', 'Sie haben kürzlich veranlasst, Ihr CRM-Passwort zurückzusetzen.\n\nUm dies jetzt zu tun, geben sie diesen Token ein: {value.token}\n\nBeachten Sie, dass der Token zeitlich begrenzt ist.\n\nWenn nicht Sie diese E-Mail angefordert haben, betrachten Sie diese als gegenstandslos. Melden Sie sich weiterhin mit Ihrem bestehendem Passwort an und löschen Sie diese E-Mail einfach.', '<p>Sie haben kürzlich veranlasst, Ihr CRM-Passwort zurückzusetzen.</p>\r\n<p>Um dies jetzt zu tun, geben sie diesen Token ein: <b>{value.token}</b></p>\r\n<p>Beachten Sie, dass der Token zeitlich begrenzt ist.</p>\r\n<p>Wenn nicht Sie diese E-Mail angefordert haben, betrachten Sie diese als gegenstandslos. Melden Sie sich weiterhin mit Ihrem bestehendem Passwort an und löschen Sie diese E-Mail einfach.</p>', 0, 'sendTokenForNewPassword', 'Users', 'de_DE', NULL),
